import React from 'react';
import styles from './App.css';

const HomePage = ({  }) => {
  return (
      <div className="cover-container d-flex w-100 h-100 p-3 mx-auto flex-column">
        <header className="mb-auto">
            <div>
                <h3 className="float-md-start mb-0">Financial Planner</h3>
                <h3 className="float-md-start mb-0">Financial Planner2</h3>
            </div>
        </header>

    <main className="px-3 nvb-main-px">
    <h3>Key in your Customer ID</h3>
    <div className="form-floating">
        <p className="lead"> <input type="email" className="form-control" id="floatingInput" placeholder="Customer ID"/></p>
    
    </div>
    <p className="lead">
      <a href="#" className="btn btn-lg btn-light fw-bold border-white nvb-btn">Submit</a>
    </p>
  
  </main>
  <footer className="mt-auto text-white-50">
    <p>Financial Planner by KKRS</p>
  </footer>
</div>
  );
};

export default HomePage;
